INSERT INTO `announcement` VALUES ('09b07158-b307-48c5-938a-be3d08f32094','PENGUMUMAN DEPT HR NO. 01/SDI-HR/PGMN/IV/2021','<p>Berikut dibawah ini pengumuman dan informasi sehubungan dengan Bulan Suci Ramadhan 1442 H, Untuk selengkapnya dibawah ini :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/13042021062206-0001_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/13042021103725-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/13042021103725-0002.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-04-13 07:09:43','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('0ee501c5-b528-4558-9f0a-3c6f514408a3','PENGUMUMAN WAJIB LAPOR PAJAK PENGHASILAN PASAL 21','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/untitled.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p>Untuk versi format pdf-nya bisa klik <a href=\"https://hrinformationsystem.com:3001/files/p-wajib_lapor_pph_21_2020.pdf\" target=\"_self\">Disini</a>&nbsp;</p>\n','2021-02-26 07:04:26','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2021-02-26 07:06:49','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62'),('0fa4b77f-4968-43ef-a196-96f6a679e90f','PENGUMUMAN DEPT HR NO. 01/SDI-HR/PGMN/VII/2021','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/penguman.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-07-08 07:54:53','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('141369a2-94dc-43cd-a9d4-011b01dd0a04','PENGUMUMAN DEPT HR NO. 03/SDI-HR/PGMN/IV/2021','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/pengumum_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-04-17 06:32:00','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('1f1157d4-2e2a-44c3-99f0-41e4504d1cc7','SYARAT & KETENTUAN SERTA CARA PENGGUNAAN VOUCHER','<p>Hallo, apa kabar karyawan/ti PT. Shindengen Indonesia?</p>\n<p>semoga dalam keadaan baik.</p>\n<p>Ada informasi terkait cara penggunaan gift voucher. silahkan klik link <a href=\"https://hrinformationsystem.com:3001/files/s&k_penggunaan_voucher.pdf\" target=\"_self\">Disini</a> untuk informasi lebih lengkap dan jelas.&nbsp;</p>\n<p></p>\n<p>Terimakasih.</p>\n<p>Salam sehat dari Dept HR.&nbsp;</p>\n','2021-07-08 08:37:19','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('20ed11af-c2e8-465c-9872-a2731dd4132b','PENGUMUMAN DEPT HR NO. 02/SDI-HR/PGMN/VIII/2021','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/pengumuman_agustus_2021_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-08-04 03:34:21','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('2900a297-8ffc-47ac-8dcc-d549c0bc2be5','PENGUMUMAN TANGGAP DARURAT COVID-19','<p style=\"text-align:start;\"><span style=\"color: rgb(35,40,44);background-color: rgb(255,255,255);font-size: 14px;font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, \"Noto Sans\", sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji;\">Hallo apa kabar seluruh karyawan/ti PT. Shindengen Indonesia? </span></p>\n<p style=\"text-align:start;\"><span style=\"color: rgb(35,40,44);background-color: rgb(255,255,255);font-size: 14px;font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, \"Noto Sans\", sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji;\">Semoga seluruh karyawan/ti dan keluarga-nya dalam kondisi sehat.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(35,40,44);background-color: rgb(255,255,255);font-size: 14px;font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, \"Noto Sans\", sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji;\">Mengingat di lingkungan PT. Shindengen Indonesia, karyawan/ti sampai saat ini banyak yang terpapar virus corona (covid-19). Oleh sebab itu Perusahaan mengeluarkan pengumuman kondisi tanggap darurat covid-19 yang ditujukan oleh seluruh karyawan/ti serta keluarganya, apa saja isi pengumuman kondisi tanggap darurat yang dikelurakan oleh PT. Shindengen Indonesia... silahkan baca lengkapnya dibawah ini :</span>&nbsp;</p>\n<img src=\"https://hrinformationsystem.com:3001/files/pengumuman_kondisi_tanggap_darurat_page-0001.jpg\" alt=\"undefined\" style=\"float:left;height: auto;width: 100%\"/>\n<p>Untuk download file pdf-nya klik <a href=\"https://hrinformationsystem.com:3001/files/pengumuman_kondisi_tanggap_darurat.pdf\" target=\"_self\">Disini</a>&nbsp;</p>\n','2021-02-18 14:22:36','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('5765fc4b-9d4f-4698-9393-958e04f9ea5c','PENGUMUMAN DEPT HR NO. 03/SDI-HR/PGMN/XII/2020','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/24122020103228-0001_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2020-12-24 07:25:37','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('61362852-c29e-4aee-9b85-d66b4b314fea','PENGUMUMAN DEPT. HR NO. 01/SDI-HR/PNGM/XI/2020','<br><div><img src=\"https://hrinformationsystem.com:3001/files/p_nop_page-0001.jpg\"></div><br><p></p>','2020-11-03 05:04:24','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('a3950774-0a0a-4eef-a7ae-2974c7a32d11','PENGUMUMAN DEPT HR NO. 02/SDI-HR/PGMN/IV/2021','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/pengumum_page-0002.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-04-17 06:31:21','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('ae990a8e-0247-48ea-8874-9cf89d8a5762','PENGUMUMAN DEPT HR NO. 001/HR-SDI/PNGM/IX/2021','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/perpanjang_pkb_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-09-10 03:47:17','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('b5239b87-0af6-4f70-90d9-4ea9eebdd6dc','PENGUMUMAN DEPT HR NO. 01/SDI-HR/PGMN/VIII/2021','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/pengumuman_agustus_2021_page-0002.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-08-04 03:33:07','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('c3759342-e15a-4c0f-8fcd-ff0d3f92d6bd','PENGUMUMAN','<p>Hallo, apa kabar karyawan/ti PT. Shindengen Indonesia? semoga dalam keadaan baik.</p>\n<p>Ada pengumuman dari Dept. HR &amp; Satgas Covid-19 PT. Shindengen Indonesia menjelang libur Idul Fitri 2021. Apa saja ya penguman tersebut, yukk baca untuk lebih jelasnya di bawah ini :&nbsp;</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/penguman_lebaran_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/penguman_lebaran_page-0002.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/penguman_lebaran_page-0003.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/penguman_lebaran_page-0004.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','2021-05-04 01:01:17','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('d69ffd85-5538-421c-bf1f-4a5c80b85004','PENGUMUMAN DEPT HR NO. 01/SDI-HR/PGMN/XII/2020','<p>Perhitungan Bonus Tahun 2020 PT. Shindengen Indonesia,</p>\n<p>Untuk lebih lengkapnya silahkan klik <a href=\"https://hrinformationsystem.com:3001/files/21122020073317-0001.pdf\" target=\"_self\">Disini</a>&nbsp;</p>\n','2020-12-21 03:54:19','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('e93c86b3-441d-4d91-98ed-d8f3da0b01d7','PENGUMUMAN DEPT HR NO. 02/SDI-HR/PGMN/XII/2020','<p>Hallo, apakabar karyawan/ti PT. Shindengen Indonesia? Semoga semua dalam keadaan sehat, baik karyawan/ti dan keluarganya.&nbsp;</p>\n<p>Perihal libur panjang pada tanggal 25 Des 2020 s/d 3 Jan 2021, Ada hal yang harus diterapkan untuk seluruh karyawan/ti PT. Shindengen Indonesia, adapun hal hal tersebut bisa dibaca <a href=\"https://hrinformationsystem.com:3001/files/21122020103747-0001.pdf\" target=\"_self\">Disini</a>&nbsp;</p>\n','2020-12-21 09:12:25','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62',NULL,NULL),('f2a7932b-36c7-4a7c-be1c-d9fb2e2a882b','JADWAL RAPID TES PT SHINDENGEN','<p>Jadwal Screening Rapid Tes PT. Shindengen Indonesia dan aturan saat di lakukan Screening Rapid Tes, lihat dibawah ini pengumuman resminya :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/rapid_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\">\n<p></p>\n<p></p>\n','2020-08-31 10:22:53','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-08-31 10:24:34','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62');
