INSERT INTO `information` VALUES ('1df674ca-d5a6-41d4-b22d-f6e1d9ffa6a8','AKTIVITAS FISIK DI MASA PANDEMI COVID-19','<p>Aktivitas fisik dan olahraga dirumah dengan cara yang tepat dapat meningkatkan daya tahan/imunitas.</p>\n<p>bagaimana caranya? yuk simak penjelasan pada poster dibawah ini :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/unnamed_(1).png\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-08-24 04:54:35',NULL,NULL),('398c697b-0b05-4384-ba7c-0dacc87f60c1','CARA MEMAKAI MASKER ','<p>Pentingnya untuk kita mengetahui cara memakai masker dengan benar ditengah pandemi virus corona dan siapa saja yang wajib menggunakan masker? silahkan lihat poster dibawah ini :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/efvsa3kvoaajkyj.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-08-24 04:17:22',NULL,NULL),('3ed765d1-866c-4182-8218-93ecc2000e0f','GERAKAN MASYARAKAT HIDUP SEHAT','<p>Ayo jaga diri dan keluarga anda dari virus corona dengan <span style=\"color: rgb(44,130,201);\"><strong>GERMAS</strong></span>, Apasih <span style=\"color: rgb(44,130,201);\"><strong>GERMAS</strong></span> itu, silahkan baca dibawah ini :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/files13178germas_virus_corona_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-08-24 03:58:25',NULL,NULL),('5919758f-2124-4490-a140-bd9f1f9af068','FORM UPDATE VAKSIN 1 & 2','<p>Silahkan update data vaksin, jika sudah melakukan vaksin, baik vaksin 1 maupun vaksin 1 &amp; 2 .</p>\n<p></p>\n<p>Link : <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSeF5_dGy-kWooHhtwwRDbhp2FFHYTtiiBex1c5SMctZNkJOdw/viewform\" target=\"_self\">Klik Disini</a>&nbsp;&nbsp;</p>\n<p>Atau Scan Barcode dibawah ini :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/update_data_vaksin_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2021-09-10 03:51:34',NULL,NULL),('6389afb8-a9a7-4317-8d50-9cfd8f3b8d52','FORM UPDATE DATA ALAMAT DOMISILI & NOMOR TELPON','<p>Alamat domisili berubah? atau nomor telpon ganti? silahkan update data tersebut dengan link dibawah ini :</p>\n<p><a href=\"https://forms.gle/tb4GoqUbCVTpGKTU9\" target=\"_self\">Kilk Disini</a>&nbsp;</p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-11-05 06:36:08',NULL,NULL),('6500fe23-585c-4fd0-969c-5bcbf3d745a5','PENYEBARAN COVID-19 DENGAN CEPAT','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/img-20200904-wa0171.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-09-04 09:40:01',NULL,NULL),('6675556d-87fa-44bb-aa26-f5d1ee84f669','CARA DOWNLOAD SERTIFIKAT VAKSIN COVID-19','<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/unduh_sertifikat_vaksin_page-0001.jpg\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2021-08-20 01:39:27',NULL,NULL),('a7e6dd79-708a-4869-9307-5c4c0d209fc8','CEGAH PENULARAN COVID-19','<p>Cara mencegah penularan covid-19, hal apa saja yang harus dilakukan?, silahkan baca poster dibawah ini :</p>\n<p></p>\n<img src=\"https://hrinformationsystem.com:3001/files/unnamed.png\" alt=\"undefined\" style=\"float:none;height: auto;width: 100%\"/>\n<p></p>\n','8bc19c8b-baf6-474f-81f1-6d5a6fb52b62','2020-08-24 05:02:36',NULL,NULL);
